keypad = [
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9]
]

aoc_input = """



""".split('\n')


def get_pos(c, pos):
    temp_pos = pos[0:]
    if c is "U":
        if temp_pos[1] is not 0:
            temp_pos[1] -= 1
    elif c is "D":
        if temp_pos[1] is not 2:
            temp_pos[1] += 1
    elif c is "L":
        if temp_pos[0] is not 0:
            temp_pos[0] -= 1
    elif c is "R":
        if temp_pos[0] is not 2:
            temp_pos[0] += 1
    print(temp_pos)
    return temp_pos


def find_code(aoc_input):
    keypress = []
    pos = [1, 1]
    for l in aoc_input:
        for c in l:
            print(c)
            pos = get_pos(c, pos)
        print(pos)
        print("-------------------------------------------------------------------------------------------------------")
        keypress.append(pos)
    print(keypress)
    for key in keypress:
        print(keypad[key[1]][key[0]])


find_code(aoc_input)
